import React from 'react';

const HocComponent = (originalValue) =>{

  class Dummy extends React.Component {
    constructor(props){
      super(props);
      this.state={
        selectedValue:'ABC'
      }
    }
    onSelect(e){
      this.setState({
            selectedValue : e.target.value,
            showMe : false,

      })
    }
    render(){
      return (
        <div>
            <div className="main">
              <originalValue 
              selectedValue={this.state.selectedValue}
              onSelect={this.onSelect}/>
            </div>

        </div>
      );
    }
    }
    return Dummy;
}



export default HocComponent;
